	/**
	 * This function will return a 6 length array. Every 2 values is a pair that represents a vertex and its normal.
	 * <br>
	 * <br>
	 * Position 0 is the index of the position for vertex1.<br>
	 * Position 1 is the index of the normal for vertex1.<br>
	 * <br>
	 * Position 2 is the index of the position for vertex2.<br>
	 * Position 3 is the index of the normal for vertex2.<br>
	 * <br>
	 * Position 4 is the index of the position for vertex3.<br>
	 * Position 5 is the index of the normal for vertex3.<br>
	 * @param faceIndex
	 * @return
	 */
	private static int[] getFaceData( int faceIndex ) {
		if ( faceIndex < TOTAL_FACES/2 ) {
			return getFirstHalfFaceData()[faceIndex];
		} else {
			return getSecondHalfFaceData()[faceIndex-(TOTAL_FACES/2)];
		}
	}

	public static BufferedMesh mesh( float radius ) {
		if ( mesh == null ) {
			
			Vector3f center = new Vector3f();
			
			// Generate all the triangles of the teapot
			ArrayList<Triangle> tris = new ArrayList<Triangle>();
			for (int i = 0; i < TOTAL_FACES; i++) {
				Triangle t = new Triangle();
				int[] faceData = getFaceData(i);
	
				// Get indices
				int vertex1PosIndex = faceData[0];
				int vertex2PosIndex = faceData[2];
				int vertex3PosIndex = faceData[4];
				int vertex1NorIndex = faceData[1];
				int vertex2NorIndex = faceData[3];
				int vertex3NorIndex = faceData[5];
	
				// Get all the vertex positions and normals
				Vector3f position1 = new Vector3f(TEAPOT_VERTS[ vertex1PosIndex-1 ]);
				Vector3f position2 = new Vector3f(TEAPOT_VERTS[ vertex2PosIndex-1 ]);
				Vector3f position3 = new Vector3f(TEAPOT_VERTS[ vertex3PosIndex-1 ]);
				Vector3f normal1 = new Vector3f(TEAPOT_NORMS[ vertex1NorIndex-1 ]);
				Vector3f normal2 = new Vector3f(TEAPOT_NORMS[ vertex2NorIndex-1 ]);
				Vector3f normal3 = new Vector3f(TEAPOT_NORMS[ vertex3NorIndex-1 ]);

				// Shift y offset to center the model.
				float yOff = -0.33f;
				position1.y += yOff;
				position2.y += yOff;
				position3.y += yOff;
				
				// Rotate to z up
				Matrix4f rotMat = new Matrix4f();
				rotMat.rotateX((float)Math.PI/2f);
				rotMat.transformDirection(position1);
				rotMat.transformDirection(position2);
				rotMat.transformDirection(position3);
				rotMat.transformDirection(normal1);
				rotMat.transformDirection(normal2);
				rotMat.transformDirection(normal3);

				center.add(position1);
				center.add(position2);
				center.add(position3);
				
				// Add vertices to triangle
				t.addVertex( new Vertex( position1.x, position1.y, position1.z, normal1.x, normal1.y, normal1.z, 0, 0) );
				t.addVertex( new Vertex( position2.x, position2.y, position2.z, normal2.x, normal2.y, normal2.z, 1, 0) );
				t.addVertex( new Vertex( position3.x, position3.y, position3.z, normal3.x, normal3.y, normal3.z, 1, 1) );
				tris.add(t);
			}
			
			center.div(TOTAL_FACES*3);
			center.mul(-1);
			
			// Create & cache the teapot mesh.
			int pointer = 0;
			mesh = new BufferedMesh( tris.size() * 3 );
			for (int i = 0; i < tris.size(); i++) {
				Triangle triangle = tris.get(i);
				mesh.setVertex(pointer++, triangle.getVertex(0).add(center));
				mesh.setVertex(pointer++, triangle.getVertex(1).add(center));
				mesh.setVertex(pointer++, triangle.getVertex(2).add(center));
			}
		}
		
		// Return a copy of the teapot mesh.
		BufferedMesh ret = new BufferedMesh( mesh.getSize() );
		for (int i = 0; i < ret.getSize(); i++) {
			Vertex vertex = mesh.getVertex(i).clone();
			vertex.setXYZ( vertex.getXYZ()[0] * radius, vertex.getXYZ()[1] * radius, vertex.getXYZ()[2] * radius);
			ret.setVertex(i, vertex);
		}
		
		ret.computeTangents();
		return ret;
	}
